import Hobby from "./LayoutUI/Hobby";
import { HobbyListData } from "../../datas/HobbyListData"


function HobbyList() {
    return (
        <div className="flex flex-col grow gap-6 p-4 md:p-6">
            {HobbyListData.map((hobby, index) =>  <Hobby name={hobby.name} icon={hobby.icon} key={index} />)}
            <a className="inline-block rounded-lg px-4 py-1.5 text-base font-semibold leading-7 text-gray-900 ring-1 ring-gray-900/10 hover:ring-gray-900/20">
                Button
            </a>
        </div>
    );
}

export default HobbyList;
